import React from 'react'
import DecktopIcon from './DesktopIcon/DecktopIcon';
import { NavLink } from 'react-router-dom';
import FolderIcon from "../../../Images/FolderIcon.png"
import MyComputerIcon from "../../../Images/MyComputer.png"
import s from "./Navbar.module.css";
import { useState } from 'react';

const Navbar = () => {

    let [SelectedItem, SetSelectedItem] = useState(0);

    return (
        <div className={ s.Navbar }>
            <DecktopIcon onClick={ () => SetSelectedItem(1) }  isCoosing={ SelectedItem == 1 } image = { MyComputerIcon } name = {"Об олимпиаде"}/>
            <DecktopIcon onClick={ () => SetSelectedItem(1) }  isCoosing={ SelectedItem == 2 } image = { FolderIcon } name = {"Направления"}/>
            <DecktopIcon onClick={ () => SetSelectedItem(1) }  isCoosing={ SelectedItem == 3 } image = { FolderIcon } name = {"Этапы"}/>
            <DecktopIcon onClick={ () => SetSelectedItem(1) }  isCoosing={ SelectedItem == 4 } image = { FolderIcon } name = {"Спонсоры"}/>
            <DecktopIcon onClick = { () => { SetSelectedItem(5) }} isCoosing={ SelectedItem == 5 } image = { FolderIcon } name = {"Регстрация"}/>
        </div>
    );
}


export default Navbar;
